import React, { useState, useEffect } from 'react';
import { Link, useNavigate, Routes, Route, useLocation } from 'react-router-dom';
import api, { getAuthToken, decodeToken, removeAuthToken } from '../../api/endpoint';
import { FiUsers, FiFileText, FiCalendar, FiActivity, FiBarChart, FiBell, FiSettings, FiLogOut, FiMenu, FiX } from 'react-icons/fi';

// Mock imports - remplacez par vos vrais composants
const MesPatients = () => <div className="p-8"><h1>Mes Patients</h1></div>;
const MesConsultations = () => <div className="p-8"><h1>Mes Consultations</h1></div>;
const MesRendezVous = () => <div className="p-8"><h1>Mes Rendez-vous</h1></div>;
const MesDossiers = () => <div className="p-8"><h1>Mes Dossiers</h1></div>;
const CreerDossier = () => <div className="p-8"><h1>Créer Dossier</h1></div>;
const Ordonnance = () => <div className="p-8"><h1>Ordonnances</h1></div>;

const DashboardHome = ({ user, stats }) => {
  return (
    <div className="space-y-8 p-6">
      <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-4 gap-6">
        <div className="bg-white p-6 rounded-xl shadow-sm border">
          <div className="flex items-center">
            <div className="p-3 bg-blue-100 rounded-xl">
              <FiUsers className="h-6 w-6 text-blue-600" />
            </div>
            <div className="ml-4">
              <p className="text-sm font-medium text-gray-500">Patients</p>
              <p className="text-2xl font-bold">{stats.patients}</p>
            </div>
          </div>
        </div>
        <div className="bg-white p-6 rounded-xl shadow-sm border">
          <div className="flex items-center">
            <div className="p-3 bg-green-100 rounded-xl">
              <FiActivity className="h-6 w-6 text-green-600" />
            </div>
            <div className="ml-4">
              <p className="text-sm font-medium text-gray-500">Consultations</p>
              <p className="text-2xl font-bold">{stats.consultations}</p>
            </div>
          </div>
        </div>
        <div className="bg-white p-6 rounded-xl shadow-sm border">
          <div className="flex items-center">
            <div className="p-3 bg-purple-100 rounded-xl">
              <FiCalendar className="h-6 w-6 text-purple-600" />
            </div>
            <div className="ml-4">
              <p className="text-sm font-medium text-gray-500">RDV</p>
              <p className="text-2xl font-bold">{stats.rendezVous}</p>
            </div>
          </div>
        </div>
        <div className="bg-white p-6 rounded-xl shadow-sm border">
          <div className="flex items-center">
            <div className="p-3 bg-indigo-100 rounded-xl">
              <FiFileText className="h-6 w-6 text-indigo-600" />
            </div>
            <div className="ml-4">
              <p className="text-sm font-medium text-gray-500">Dossiers</p>
              <p className="text-2xl font-bold">{stats.dossiers}</p>
            </div>
          </div>
        </div>
      </div>
      <div className="bg-white p-6 rounded-xl shadow-sm border">
        <h3 className="text-lg font-semibold mb-4">Bienvenue Dr. {user?.nom}</h3>
        <p className="text-gray-600">Votre tableau de bord médecin est prêt.</p>
      </div>
    </div>
  );
};

// Copiez la même structure que AdminDashboard avec navigation médecin
const MedecinDashboard = () => {
  // ... Même logique que AdminDashboard mais pour médecin
  // Utilisez le même JSX de sidebar/topbar ci-dessus
  return (
    <div className="min-h-screen bg-gray-100">
      {/* Sidebar + Topbar identique à AdminDashboard */}
      <div className="lg:ml-64">
        <header className="bg-white shadow-sm border-b p-4 lg:p-6">
          {/* Topbar identique */}
        </header>
        <main style={{ padding: '20px', minHeight: 'calc(100vh - 64px)' }}>
          <Routes>
            <Route path="/" element={<DashboardHome user={user} stats={stats} />} />
            {/* Vos routes médecin */}
          </Routes>
        </main>
      </div>
    </div>
  );
};

export default MedecinDashboard;
